import styled from 'styled-components';

export const StyledLi = styled.li`
	margin-bottom: 10px;
	background-color: lightgrey;
	padding: 6px;
	cursor: pointer;
`;

export const StyledTitle = styled.h1`
	margin-bottom: 10px;
	margin-top: 20px;
`;
